//ProviderPage.js
import React, { useState } from 'react';
import SomeComponent from '../pages/CargaProducto';
//import AnotherComponent from './AnotherComponent';

function ProviderPage() {
    const [currentView, setCurrentView] = useState('view1');

    return (
        <div>
            {/* Aquí puedes tener una barra de navegación o botones para cambiar la vista */}
            <button onClick={() => setCurrentView('view1')}>Vista 1</button>
            <button onClick={() => setCurrentView('view2')}>Vista 2</button>

            {/* Renderizado condicional */}
            {currentView === 'view1' && <SomeComponent />}
            {currentView === 'view2' && <AnotherComponent />}
            {/* ... más vistas según sea necesario */}
        </div>
    );
}

export default ProviderPage;
